function ad_inject(post_selector,ads){var p=document.querySelectorAll(post_selector+' >p,'+post_selector+' >div');let pos=Math.floor(p.length*(1/3));for(var i=0;i<ads.length;i++){create_ad(ads[i]).insertAfter(p[pos*(i+1)])}}
